import React from 'react';
import './styles.scss';
NavBar.propTypes = {};

function NavBar(props) {
	return (
		<ul className='nav-bar-control d-flex d-flex-center'>
			<li>All</li>
			<li>Active</li>
			<li>Completed</li>
		</ul>
	);
}

export default NavBar;
